import { Component } from '@angular/core';

@Component({
  selector: 'app-yuca',
  templateUrl: './yuca.component.html',
  styleUrls: ['./yuca.component.scss']
})
export class YucaComponent {

}
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>YUCA</title>
  <style>
    body {
      font-family: 'Roboto', sans-serif;
      margin: 0;
      display: flex;
      justify-content: center;
      align-items: center;
      height: 100vh;
      background-image: url('yucaFondo.jpg'); /* Reemplaza 'ruta/de/tu/imagen.jpg' con la ruta de tu imagen */
      background-size: cover;
      background-position: center;
    }

    .container {
      text-align: center;
      background: rgba(255, 255, 255, 0.8); /* Fondo blanco con un poco de transparencia */
      padding: 20px;
      border-radius: 8px;
      box-shadow: 0 4px 8px rgba(0,0,0,0.1);
    }

    .button-container {
      display: flex;
      justify-content: center;
      gap: 10px;
      margin-top: 20px;
    }

    button {
      padding: 10px 20px;
      border: none;
      border-radius: 5px;
      cursor: pointer;
      transition: background-color 0.3s;
    }

    #button1 {
      background-color: #007bff;
      color: white;
    }

    #button1:hover {
      background-color: #0056b3;
    }

    #button2 {
      background-color: #28a745;
      color: white;
    }

    #button2:hover {
      background-color: #1e7e34;
    }
  </style>
</head>
<body>
  <div class="container">
    <h1>Deep Learning con hoja de yuca</h1>
    <div class="button-container">
      <button id="button1">Ejemplos</button>
      <button id="button2">Modelo</button>
    </div>
  </div>
</body>
</html>
